api.sso.msalConfig=function(pClientId,pAuthority,pRedirectUri){return{auth:{clientId:pClientId,authority:pAuthority,redirectUri:pRedirectUri,navigateToLoginRequestUrl:false},cache:{cacheLocation:"localStorage",storeAuthStateInCookie:false},system:{loggerOptions:{loggerCallback:(level,message,containsPii)=>{if(containsPii){return}switch(level){case msal.LogLevel.Error:return;case msal.LogLevel.Info:return;case msal.LogLevel.Verbose:return;case msal.LogLevel.Warning:return}}}}}};